status.description:
Door's status. Values:
0 - No status;
1 - Door closed;
2 - Door open; Values: 0 = UNKNOW;1 = CLOSED;2 = OPENED;3 = BREAKED

selectedStatus.description:
If set, returns the occurrences from the specified status:
0 - None;
1 - Open;
2 - InProgress;
3 - OnHold;
4 - Close;
-1 - Hanging.

durationOperator.description:
If set, defines how the duration query will be
0 - None;
1 - Greater than;
2 - Less than;
3 - Greater or equal;
4 - Less or equal. Values: 0 = NONE;1 = GREATER_THAN;2 = LESS_THAN;3 = GREATER_EQUAL;4 = LESS_EQUAL

